import React from 'react'
import Slide from "react-slick"

function Subheader() {
    const settings = {
        dots: true,
        pauseOnFocus:true,
        infinite: true,
        arrows:false,
        speed: 400,
        slidesToShow: 10,
        autoplay:true,
        slidesToScroll: 1
      };
    
    const companys = [
        {
            name:"LC WAİKİKİ",
            img:"ssss"
        }
    ]
    return (
        <div className="container mx-auto w-full flex mt-20 items-center "> 
            {companys.map((data)=>{
                return(<p className="text-black">{data.name}</p>)
            })}
        </div>
    )
}

export default Subheader
